import React, { useState } from "react";
import "./NotesList.css";

const NotesList = () => {
  const [notes, setNotes] = useState([
    {
      id: 1,
      title: "First Note",
      body: "First Note Body",
      category: "Programming",
    },
    {
      id: 2,
      title: "Second Note",
      body: "Second Note Body",
      category: "Mathematic",
    },
    {
      id: 3,
      title: "Third Note",
      body: "Third Note Body",
      category: "Design",
    },
  ]);
  return (
    <div className="note-list">
      <p>
        <h1>List of Notes</h1>
        <span>{notes.length}</span>
      </p>
      {notes.map((note) => (
        <div key={note.id}>
          <p style={{ fontSize: "24px", fontWeight: "bold" }}>{note.title}</p>
          <p>{note.body}</p>
        </div>
      ))}
    </div>
  );
};

export default NotesList;
